  false,\n\t\"url\": null,\n\t\"notes\": \"Rugosity is derived from gridded (5 m cell
  size) multibeam bathymetry, aboard NOAA Ship Oscar Elton Sette. Cell values reflect
  the (surface area) / (planimetric area) ratio for the area contained within that
  cell's boundaries. They provide indices of topographic roughness & convolutedness.
  The bathymetry grid includes multibeam bathymetry from the Reson 8101 multibeam
  sonar aboar the NOAA Ship Oscar E. Sette collected as of May 2010 by the NOAA Coral
  Reef Ecosystem Division in depths between 10 and 300 meters. These data complement
  multibeam data collected by the U.S. Naval Oceanographic Office at FDM during several
  test cruises, which are available from NOAA's National Geophysical Data Center.\",\n\t\"owner_org\":
